class Menu extends Component {
    constructor(props) {
        super(props);
        this.state = {
            barreNavigation: [{ nomElement: 'Habilitation', arraySousElement: [{ nomSousElement: 'Gestion role' }, { nomSousElement: 'Gestion utilisateur' }]},{ nomElement: 'Scolarite', arraySousElement: [{ nomSousElement: 'Matieres par formation' }, { nomSousElement: 'Papiers Apportées' },{ nomSousElement: 'Frais formation' },{ nomSousElement: 'Niveaux' },{ nomSousElement: 'Formations' },{ nomSousElement: 'Specialités' },{ nomSousElement: 'Matieres' },{ nomSousElement: 'Filiéres' },{ nomSousElement: 'Niveau de base' },{ nomSousElement: 'Type enseignement' }]},{ nomElement: 'Eleve', arraySousElement: [{ nomSousElement: 'Apprenants' }, { nomSousElement: 'Groupes' }, { nomSousElement: 'Types paiements eleves' }]},{ nomElement: 'Formateur', arraySousElement: [{ nomSousElement: 'Enseignants' }, { nomSousElement: 'Paiement enseignants' }]},{ nomElement: 'Reglement', arraySousElement: [{ nomSousElement: 'Reglements eleves' }]}]
        }
    }

    render() {
        return (
            <div id="page-wrapper" style={{ minHeight: '263px', marginLeft: '0px' }}>
                <div className="container-fluid">
                    <div className="row bg-title">
                        <div className="col-lg-12">
                            <h4 className="page-title">Menu</h4>
                        </div>
                        {/* /.col-lg-12 */}
                    </div>
                    {/* /.row */}
                    <div class="row">
                        <div class="col-sm-12">
                            <div class="white-box">
                                <div class="row">
                                    {this.state.barreNavigation.map((el, index) =>
                                        <div className="col-md-4">
                                            <div className="white-box">
                                                <h3>{el.nomElement}</h3>
                                                <div className="myadmin-dd dd" id="nestable">
                                                    <ol className="dd-list">
                                                        <li className="dd-item" data-id={index}>
                                                            {el.arraySousElement.map(el =>
                                                                <div className="dd-handle">{el.nomSousElement}</div>)}
                                                        </li>
                                                    </ol>
                                                </div>
                                            </div>
                                        </div>)}
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Menu;
